import React from 'react';

const Header = () => {
  return (
    <header className="header">
      <div className="header__content">
        <div className="header__logo">
          <img src="./../../public/assets/jpeg/kamesh.jpg" alt="Profile" className="header__logo-img" />
          <h1 className="header__name">Kamesh Pansare</h1>
          <p className="header__title">Software Developer</p>
        </div>
      </div>
    </header>
  );
};

export default Header;
